import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import AddDogadaj from "./components/AddDogadaj";
import Dogadaj from "./components/Dogadaj";
import DogadajiList from "./components/DogadajiList";

function App() {
  return (
    <div>
      <nav className="navbar navbar-expand navbar-dark bg-dark">
        <a href="/Dogadaji" className="navbar-brand">
          GOREvent
        </a>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/Dogadaji"} className="nav-link">
              DogaÄ‘aji
            </Link>
          </li>
          <li className="nav-item">
            <Link to={"/add"} className="nav-link">
              Dodaj
            </Link>
          </li>
        </div>
      </nav>

      <div className="container mt-3">
        <Switch>
          <Route exact path={["/", "/Dogadaji"]} component={DogadajiList} />
          <Route exact path="/add" component={AddDogadaj} />
          <Route path="/Dogadaji/:id" component={Dogadaj} />
        </Switch>
      </div>
    </div>
  );
}

export default App;
